	 (774,6792,N'Sundsvalls Kommun',N'http://sundsvall.se/vuxenutbildning',N'SGRIND7',N'Individ och samhälle',N'Kommunal vuxenutbildning som anpassad utbildning på grundläggande nivå',N'https://sundsvall.alvis.se/hittakurser/kurs/59390',1200.0,N'<![CDATA[ <p>Komvux som anpassad&nbsp;utbildning är för dig som har en intellektuell funktionsnedsättning eller förvärvad hjärnskada.</p><p>Kursen är för dig som vill:&nbsp;</p><ul>	<li>	<p>studera närmiljön, traditioner och högtider</p>	</li>	<li>	<p>samtala om livsfrågor, kamratskap och relationer</p>	</li>	<li>	<p>diskutera aktuella händelser i samhället</p>	</li></ul><p>Studietakt: individuell</p><p>Nivå: grundläggande</p><p>Antagning: löpande i mån av plats</p><div>&nbsp;</div><br />&nbsp; ]]>',NULL,NULL,100.0,'2023-04-01 00:00:00.0000000','2023-09-17 00:00:00.0000000',N'Sundsvall',N'SGRIND7',NULL),
	 (775,6793,N'Sundsvalls Kommun',N'http://sundsvall.se/vuxenutbildning',N'SGRINDU',N'Vardagsrutiner och vardagsmiljö',N'Kommunal vuxenutbildning som anpassad utbildning på grundläggande nivå',N'https://sundsvall.alvis.se/hittakurser/kurs/59533',400.0,N'<![CDATA[ <p>Komvux som anpassad&nbsp;utbildning är för dig som har en intellektuell funktionsnedsättning eller förvärvad hjärnskada.</p><p>Kursen är för dig som vill:</p><ul>	<li>	<p>lära dig om redskap, verktyg och teknisk utrustning som används i hushållet</p>	</li>	<li>	<p>lära dig mer om inköp, planering och genomförande</p>	</li>	<li>	<p>veta mer om sambandet mellan mat och hälsa</p>	</li></ul><p>Studietakt: individuell</p><p>Nivå: grundläggande</p>Antagning: löpande i mån av plats<br />&nbsp; ]]>',NULL,NULL,100.0,'2023-04-01 00:00:00.0000000','2023-09-17 00:00:00.0000000',N'Sundsvall',N'SGRINDU',NULL),
