	 (843,6976,N'Kramfors kommun, Yrkeshögskolan Höga kusten',N'www.yhk.se',N'YH01528',N'Specialiserad möbelsnickare med inriktning mot gesäll',N'yrkeshögskoleutbildning',N'https://www.yhk.se',200.0,N'Utbildningen för dig som vill ha ett gesäll-brev, ett kvalitetsbevis på att du har ett djupt yrkeskunnande och uppfyller branschens krav.Utbildningens innehållUtbildningen innehåller kurser i affärs- utveckling, design, produktutveckling, konstruktion och arbetsplanering, CNC och avslutas med ett examensarbete inriktat mot gesäll. En specialiserad möbel-snickare är en viktig traditionsbärare inom trähantverk och vår tillgång till historiska originalmöbler i undervisningen, är unikt och värdefullt i undervisningssyfte.','2023-09-04 00:00:00.0','2024-06-07 00:00:00.0',100.0,NULL,'2023-05-15 00:00:00.0000000',N'Kramfors',N'415543c',NULL),
