	 (846,6983,N'YH Akademin AB',N'https://ya.se/yrkeshogskola/',N'YH00118',N'Affärsutvecklare besöksnäring',N'yrkeshögskoleutbildning',N'https://ya.se/yrkeshogskola/affarsutvecklare-besoksnaring/',400.0,N'Vill du arbeta med turism eller är du redan verksam inom besöksnäringen? Är du en kreativ optimist som gillar att utveckla, förbättra och hitta nya vägar framåt? Har du lätt för att nätverka och tycker om att påverka? Då är den här utbildningen något för dig!Att jobba som affärsutvecklareSom affärsutvecklare arbetar du med att driva och utveckla ett företag eller en organisation framåt. Du arbetar ofta nära ledningen och tar fram underlag genom att analysera nuläge, och göra omvärldsanalyser för att kunna föreslå en bra väg framåt för företaget. Det kan handla om nya produkter eller att förbättra system och funktioner.En utbildning som ger dig bred kompetensYrkesAkademins utbildning till affärsutvecklare inom besöksnäring ger dig kompetens att utveckla och paketera tjänster inom turist- och besöksnäringen. Utbildningen ger dig verktyg att kunna analysera marknadstendenser och trender, och att projektleda konceptutveckling och digitalt förändringsarbete. Du kommer också att ha kunskaper i att använda analysmaterial för att identifiera affärsmöjligheter och skapa attraktiva paket och tjänster för potentiella kunder.Jobbmöjligheter inom besöksnäringenBesöksnäringen räknas som världens största och snabbast växande näring. Fram till år 2020 förväntas den svenska besöksnäringens omfattning och exportvärde fördubblas. Därför finns det goda jobbmöjligheter för affärsutvecklare med rätt kompetens och utbildning. Yrkesrollen är också viktig då företag i dag har ständigt höga krav på förbättring och utveckling för att öka konkurrenskraften.Ta ditt nästa karriärsteg hos oss på YrkesAkademin Yrkeshögskola','2024-01-01 00:00:00.0','2025-12-31 00:00:00.0',100.0,NULL,'2023-11-06 00:00:00.0000000',N'Härnösand',N'525812z',NULL),
	 (847,6983,N'YH Akademin AB',N'https://ya.se/yrkeshogskola/',N'YH00118',N'Affärsutvecklare besöksnäring',N'yrkeshögskoleutbildning',N'https://ya.se/yrkeshogskola/affarsutvecklare-besoksnaring/',400.0,N'Vill du arbeta med turism eller är du redan verksam inom besöksnäringen? Är du en kreativ optimist som gillar att utveckla, förbättra och hitta nya vägar framåt? Har du lätt för att nätverka och tycker om att påverka? Då är den här utbildningen något för dig!Att jobba som affärsutvecklareSom affärsutvecklare arbetar du med att driva och utveckla ett företag eller en organisation framåt. Du arbetar ofta nära ledningen och tar fram underlag genom att analysera nuläge, och göra omvärldsanalyser för att kunna föreslå en bra väg framåt för företaget. Det kan handla om nya produkter eller att förbättra system och funktioner.En utbildning som ger dig bred kompetensYrkesAkademins utbildning till affärsutvecklare inom besöksnäring ger dig kompetens att utveckla och paketera tjänster inom turist- och besöksnäringen. Utbildningen ger dig verktyg att kunna analysera marknadstendenser och trender, och att projektleda konceptutveckling och digitalt förändringsarbete. Du kommer också att ha kunskaper i att använda analysmaterial för att identifiera affärsmöjligheter och skapa attraktiva paket och tjänster för potentiella kunder.Jobbmöjligheter inom besöksnäringenBesöksnäringen räknas som världens största och snabbast växande näring. Fram till år 2020 förväntas den svenska besöksnäringens omfattning och exportvärde fördubblas. Därför finns det goda jobbmöjligheter för affärsutvecklare med rätt kompetens och utbildning. Yrkesrollen är också viktig då företag i dag har ständigt höga krav på förbättring och utveckling för att öka konkurrenskraften.Ta ditt nästa karriärsteg hos oss på YrkesAkademin Yrkeshögskola','2024-01-01 00:00:00.0','2025-12-31 00:00:00.0',100.0,NULL,'2023-11-06 00:00:00.0000000',N'Örnsköldsvik',N'525812z',NULL),
