	 (850,6986,N'Härnösands kommun, Yrkeshögskolan',N'https://www.hetautbildningar.se',N'YH00090',N'Drifttekniker Kraft & Värme',N'yrkeshögskoleutbildning',N'http://www.hetautbildningar.se',400.0,N'Vill du skaffa dig en utbildning som är hett efterfrågad och som ger dig varierande och intressanta uppgifter i jobbet? Med vår utbildning till Drifttekniker kraft & värme hamnar du mitt i en spännande bransch med ständig utveckling, där du arbetar med en av samhällets allra viktigaste funktioner. Försörjningen av värme, elkraft och kyla måste hållas igång dygnet runt samtidigt som ny teknik och smarta lösningar för att spara energi, pengar och miljö införs. Som drifttekniker är du en nyckelperson i allt från praktiskt arbete med drift och underhåll av energiteknisk utrustning till användning av den senaste IT-tekniken för styrning och optimering. De omfattande perioderna av praktik (LIA - Lärande i Arbete) gör att du redan tidigt i utbildningen får nyttig erfarenhet och är redo att gå direkt ut i arbetslivet, kanske hos en arbetsgivare som du redan under utbildningen har knutit kontakt med. Samtidigt ger breda praktiska och teoretiska kunskaper dig möjligheter att utvecklas och ta större ansvar inom nya yrkesroller och teknikområden.','2023-09-04 00:00:00.0','2025-06-08 00:00:00.0',100.0,NULL,NULL,N'Härnösand',N'525522d',NULL);
