	 (851,6987,N'Härnösands kommun, Yrkeshögskolan',N'https://www.hetautbildningar.se',N'YH00090',N'Drifttekniker Kraft & Värme',N'yrkeshögskoleutbildning',N'http://www.hetautbildningar.se',400.0,N'Vill du skaffa dig en utbildning som är hett efterfrågad och som ger dig varierande och intressanta uppgifter i jobbet? Med vår utbildning till Drifttekniker kraft & värme hamnar du mitt i en spännande bransch med ständig utveckling, där du arbetar med en av samhällets allra viktigaste funktioner. Försörjningen av värme, elkraft och kyla måste hållas igång dygnet runt samtidigt som ny teknik och smarta lösningar för att spara energi, pengar och miljö införs. Som drifttekniker är du en nyckelperson i allt från praktiskt arbete med drift och underhåll av energiteknisk utrustning till användning av den senaste IT-tekniken för styrning och optimering. De omfattande perioderna av praktik (LIA - Lärande i Arbete) gör att du redan tidigt i utbildningen får nyttig erfarenhet och är redo att gå direkt ut i arbetslivet, kanske hos en arbetsgivare som du redan under utbildningen har knutit kontakt med. Samtidigt ger breda praktiska och teoretiska kunskaper dig möjligheter att utvecklas och ta större ansvar inom nya yrkesroller och teknikområden.','2024-09-01 00:00:00.0','2026-06-30 00:00:00.0',100.0,NULL,NULL,N'Härnösand',N'525522d',NULL),
	 (852,6988,N'Sundsvalls kommun, Vuxenutbildningen',N'www.yhmitt.se',N'YH01752',N'Informationssäkerhetsspecialist',N'yrkeshögskoleutbildning',N'https://sundsvall.se/utbildning-och-forskola/yrkeshogskolan-mitt',200.0,N'Informationssäkerhet berör all tillgänglig information i såväl gammalt som nytt format. Det innebär all skyddsvärd information som finns nedskriven i pärmar, anteckningar och arkiv. Informationssäkerhet handlar mycket om hur medarbetare och ledning är skyldiga att hantera viss information, hur gammal information kan och ska gallras ut samt vad som inte får lagras överhuvudtaget, enligt gällande regelverk.Informationssäkerhet är de åtgärder som vidtas för att hindra att information läcker ut, förvanskas eller förstörs och för att informationen ska vara tillgänglig när den behövs. För en organisation kan det handla om att skydda information mot en uppsättning hot för att säkerställa verksamhetens kontinuitet, minimera verksamhetsrisken och maximera avkastningen på investeringar och affärsmöjligheter.Informationssäkerhetsbranschens kravprofil på medarbetare är en hög ämnesteoretisk kompetens samt även kompetenser som initiativförmåga, analytisk fallenhet, problemlösningsförmåga, samarbetsförmåga och driftighet till självständigt arbete.Utbildningen bedrivs på distans med nio fasta träffar på studieorten (Sundsvall).Studietakt 75 %. ','2023-09-04 00:00:00.0','2024-12-06 00:00:00.0',75.0,NULL,NULL,N'Sundsvall',N'415869z',NULL),
	 (853,6989,N'Sundsvalls kommun, Vuxenutbildningen',N'www.yhmitt.se',N'YH01752',N'Informationssäkerhetsspecialist',N'yrkeshögskoleutbildning',N'https://sundsvall.se/utbildning-och-forskola/yrkeshogskolan-mitt',200.0,N'Informationssäkerhet berör all tillgänglig information i såväl gammalt som nytt format. Det innebär all skyddsvärd information som finns nedskriven i pärmar, anteckningar och arkiv. Informationssäkerhet handlar mycket om hur medarbetare och ledning är skyldiga att hantera viss information, hur gammal information kan och ska gallras ut samt vad som inte får lagras överhuvudtaget, enligt gällande regelverk.Informationssäkerhet är de åtgärder som vidtas för att hindra att information läcker ut, förvanskas eller förstörs och för att informationen ska vara tillgänglig när den behövs. För en organisation kan det handla om att skydda information mot en uppsättning hot för att säkerställa verksamhetens kontinuitet, minimera verksamhetsrisken och maximera avkastningen på investeringar och affärsmöjligheter.Informationssäkerhetsbranschens kravprofil på medarbetare är en hög ämnesteoretisk kompetens samt även kompetenser som initiativförmåga, analytisk fallenhet, problemlösningsförmåga, samarbetsförmåga och driftighet till självständigt arbete.Utbildningen bedrivs på distans med nio fasta träffar på studieorten (Sundsvall).Studietakt 75 %. ','2024-08-01 00:00:00.0','2025-12-31 00:00:00.0',75.0,NULL,NULL,N'Sundsvall',N'415869z',NULL),
	 (854,6992,N'Kramfors kommun, Yrkeshögskolan Höga kusten',N'www.yhk.se',N'YH00585',N'Mätningstekniker',N'yrkeshögskoleutbildning',N'https://www.yhk.se/utbildningar/matningstekniker/',415.0,N'För en mätningstekniker är oftast inte den ena dagen lik den andra. Mätnings- teknikern är den som både kan planera och driva mätningsarbeten i projektet och som har koll på att ritningar och mätdata sköts på rätt sätt och ser till att toleranser och krav efterhålls. En mätningstekniker kan jobba med t.ex. mark- och anläggningsjobb hus- utsättning, byggverksamhet, upp-datering av stomnät, kartor och fastigheter, projekteringsmätning och inmätningar.  Arbetet består till stor del av samarbete med kollegor och kontakter med andra entreprenörer, privatpersoner, företag och myndigheter. VEM ÄR DU?För att trivas som mätningstekniker bör du tycka om att jobba med utmaningar och är bra på att hantera snabba ändringar som kan uppstå i ett projekt. Du tycker det är roligt med problemlösning, teknik och beräkning och tror dig vara modig nog att kunna tänka nytt när det krävs.UTBILDNINGENS INNEHÅLLUtbildningen innehåller bland annat kurser inom geodetisk mätningsteknik, mark- och anläggningsteknik, kartteknik samt yrkesmatematik.I kurserna använder du avancerade digitala mätinstrument som totalstationer, scanner och GPS-stationer, man mäter både optiskt och med hjälp av satelliter för att samla in mätdata.Du bearbetar sedan informationen i datorer med tillhör- ande beräknings och grafiska program. Under de två åren blandas teoretisk utbildning med fältövningar och praktiska tillämpningar. Stora delar av utbildningen sker ute på arbetsplatser (LIA- Lärande i arbete).VAR FINNS JOBBEN?Mätningsteknikerns kompetens är högt efterfrågad och jobben finns hos konsultföretag, entreprenörer, kommuner men även hos statliga organisationer som exempelvis Lantmäteriet Trafikverket och Vattenfall. Gruvnäring, elbolag och skogsbolag är branscher och organisationer som har behov av mätningsteknisk kompetens.Efter avslutad utbildningen kommer du att kunna söka jobb som mätnings- tekniker, mätningsingenjör, kart- och mätingenjör, karttekniker och lantmäteritekniker.ETT FRAMTIDSYRKE!Det råder idag och under lång tid fram- över stor brist på utbildade mätnings- tekniker. Konsultföretag, som erbjuder tjänster inom mätteknik, har ökat markant i landet och flera företagsledare uttrycker önskemål om att kunna expandera om man hittar kompetent personal.BÄSTA LÄRAREN ÄR VERKLIGHETENUtbildningen är upplagd så att du som studerande skall få så bra förutsättningar som möjligt i din kommande yrkesroll, en stor del av utbildningen sker därför ute på olika företag i kursen Lärande i arbete (LIA). ','2023-08-21 00:00:00.0','2025-05-16 00:00:00.0',100.0,NULL,'2023-05-15 00:00:00.0000000',N'Kramfors',N'525580x',NULL),
