	 (856,6995,N'Kramfors kommun, Yrkeshögskolan Höga kusten',N'www.yhk.se',N'YH00593',N'Specialiserad undersköterska i demensvård',N'yrkeshögskoleutbildning',N'https://www.yhk.se',200.0,N'Utbildningen vänder sig till dig som vill ha fördjupade kunskaper om demenssjuk-domar och dess konsekvenser för individen och närstående.Du har ett genuint intresse för arbete med människor och en vilja att utveckla dig själv och andra inom området.Utbildningens innehållAtt arbeta med personer med demens-sjukdom, kräver mycket av dig som vårdare.Med utbildningen stärks du i din roll genom att få fördjupade kunskaper.','2023-08-28 00:00:00.0','2025-05-16 00:00:00.0',50.0,NULL,NULL,N'Kramfors',N'415723r',NULL),
